def UM(event=None):
    MY=list((var.get() or 'xswl').strip())
    UMW=list(t1.get(1.0,END).strip())
    rand1=list(str(random.randint(1000,9999)))
    
    if not UMW:
        msgbox.showinfo(title='注意', message="请输入'明文'！")
        return 0
    
    My=[]
    n=-1
    for i in MY:
        n+=1
        if n==4:
            n=0
        My.append(chr(ord(i)^int(rand1[n])))
    
    var.set(''.join(My))
    
    My.reverse()
    [My.append(chr(ord(gg))) for gg in list('skb973')]

    umw=[]
    m=-1
    for i in UMW:
        m+=1
        if m>=len(My):
            m=0
        umw.append(chr(abs(~(ord(i)+ord(My[m])%64))))
    t2.delete(1.0,END)
    t2.insert(END,''.join(umw))
    

def DM(event=None):
    MY=list(var.get().strip())
    DMW=list(t2.get(1.0,END).strip())
    
    if not DMW and not MY:
        msgbox.showinfo(title='注意', message="请输入'密文'及'密钥'！")
        return 0
    elif not MY:
        msgbox.showinfo(title='注意', message="请输入'密钥'！")
        return 0
    elif not DMW:
        msgbox.showinfo(title='注意', message="请输入'密文'！")
        return 0

    MY.reverse()
    [MY.append(chr(ord(gg))) for gg in list('skb973')]

    dmw=[]
    j=-1
    for i in DMW:
        j+=1
        if j>=len(MY):
            j=0
        dmw.append(chr(~-abs(ord(i)-ord(MY[j])%64)))
    t1.delete(1.0,END)
    t1.insert(END,''.join(dmw))

